WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Apa kabar!

Sejak versi WordPress 5.2 ini telah disertakan fitur untuk mendeteksi apakah plugin atau tema menyebabkan eror yang fatal pada situs Anda, dan otomatis akan memberitahu Anda melalui e-mail seperti ini.
###CAUSE###
Pertama, kunjungi situs Anda (###SITEURL###) dan cek apakah ada masalah yang terlihat. Selanjutnya, kunjungi laman di mana kesalahan telah terdeteksi (###PAGEURL###) dan cek apakah ada masalah yang terlihat.

###SUPPORT###

Jika situs Anda terlihat rusak dan Anda tidak bisa mengakses laman dasbor Anda secara normal, saat ini WordPress telah memiliki fitur spesial yaitu "mode pemulihan". Dengan ini, Anda bisa masuk ke dasbor Anda dan menginvestigasi lebih lanjut.

###LINK###

Untuk membuat situs Anda aman, tautan berikut akan berakhir pada ###EXPIRES###. Namun anda tidak perlu khawatir tentang hal ini, tautan yang baru akan dikirimkan ke email Anda apabila kesalahan terjadi lagi setelah tautan berakhir.

Ketika meminta bantuan terkait masalah ini, Anda mungkin akan dimintai informasi berikut: 
