###SITEURL###','Only UUID V4 is supported at this time.'=>'Hanya UUID V4 yang didukung saat ini.','The Press This plugin is required.'=>'Membutuhkan plugin Press This.','%s themes'=>'%s tema','Filter themes (%s)'=>'Saring tema (%s)','Go to theme sources'=>'Pergi ke sumber tema','Search WordPress.org themes'=>'Mencari tema WordPress.org','Install &amp; Preview'=>'Memasang &amp; Pratinjau','Invalid URL.'=>'URL Tidak Sah.','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'Saatnya menambahkan beberapa tautan! Klik &#8220;%s&#8221; untuk menempatkan laman, kategori, dan tautan khusus di menu Anda. Tambahkan sebanyak yang Anda inginkan.','Choose image'=>'Pilih gambar','Choose audio'=>'Pilih audio','Change audio'=>'Ganti audio','Select audio'=>'Pilih audio','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klik &#8220;Tambah Gambar Baru&#8221; untuk mengunggah berkas gambar dari komputer Anda. Tema Anda paling cocok dengan gambar tajuk tinggi %s piksel &#8212; Anda bisa memangkasnya setelah selesai diunggah untuk menyesuaikan ukurannya.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header width of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klik &#8220;Tambah Gambar Baru&#8221; untuk mengunggah berkas gambar dari komputer Anda. Tema Anda paling cocok dengan gambar tajuk lebar %s piksel &#8212; Anda bisa memangkasnya setelah selesai diunggah untuk menyesuaikan ukurannya.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klik &#8220;Tambah Gambar Baru&#8221; untuk mengunggah berkas gambar dari komputer Anda. Tema Anda paling cocok dengan gambar tajuk ukuran %s piksel &#8212; Anda bisa memangkasnya setelah selesai diunggah untuk menyesuaikan ukurannya.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Klik &#8220;Tambah Gambar Baru&#8221; untuk mengunggah berkas gambar dari komputer Anda. Tema Anda paling cocok dengan ukuran gambar yang sesuai dengan ukuran video &#8212; Anda bisa memangkasnya setelah selesai diunggah untuk menyesuaikan ukurannya.','%1$s-%2$s'=>'%1$s-%2$s','Meridian'=>'Meridian','Minute'=>'Menit','Hour'=>'Jam','Time'=>'Waktu','Day'=>'Hari','Month'=>'Bulan','Date'=>'Tanggal','Usage of user levels is deprecated. Use capabilities instead.'=>'Penggunaan level pengguna sudah tidak berlaku lagi. Gunakan kapabilitas sebagai penggantinya.','The theme defines itself as its parent theme. Please check the %s header.'=>'Tema menentukan dirinya sendiri sebagai induk temanya. Silakan periksa tajuk ini %s.','Name for the Visual editor tabVisual'=>'Visual','Create New Menu'=>'Buat Menu Baru','New Menu'=>'Menu Baru','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Jika tema Anda mempunyai area widget, Anda bisa juga menambah menu di sana. Kunjungi <a href="%s">panel Widget</a> dan tambahkan &#8220;widget Menu Navigasi&#8221; untuk menampilkan menu pada bilah sisi atau kaki.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Jika tema Anda memiliki banyak menu, pemberian nama yang jelas akan menolong Anda ketika menatanya.','Your theme can display menus in %s location.'=>'Tema Anda bisa menampilkan menu di %s lokasi.' . "\0" . 'Tema Anda bisa menampilkan menu di %s lokasi.','Your theme can display menus in one location.'=>'Tema Anda bisa menampilkan menu di satu lokasi.','CSS code'=>'Kode CSS','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'Bidang sunting otomatis menyoroti kode sintak. Anda bisa mematikan ini pada <a href="%1$s" %2$s>profil pengguna%3$s</a> Anda untuk bekerja dalam mode teks biasa.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'Layar baca pengguna: pada mode formulir, Anda harus menekan tombol Esc dua kali.','To move away from this area, press the Esc key followed by the Tab key.'=>'Untuk meninggalkan area ini, tekan tombol Esc diikuti dengan tombol Tab.','In the editing area, the Tab key enters a tab character.'=>'Di area penyuntingan, tombol Tab akan mengetikkan karakter tab.','When using a keyboard to navigate:'=>'Ketika menggunakan papan ketik untuk menjelajah:','Add your own CSS code here to customize the appearance and layout of your site.'=>'Tambahkan kode CSS Anda sendiri untuk menata penampilan dan tata letak situs Anda.','Your homepage displays'=>'Tampilan beranda Anda','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'Anda bisa memilih apa yang ditampilkan di beranda situs Anda. Hal itu bisa diposkan dengan urutan kronologi terbalik (blog klasik), atau laman tetap. Untuk mengeset beranda tetap, Anda harus membuat dua laman. Satu sebagai beranda, dan lainnya untuk menempatkan pos yang Anda tampilkan.','Homepage Settings'=>'Pengaturan Beranda','WordPress.org themes'=>'Tema WordPress.org','Installed themes'=>'Tema terpasang','Publish Settings'=>'Pengaturan penerbitan','Copied'=>'Disalin','Preview Link'=>'Tautan Pratinjau','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'Lihatlah bagaimana perubahan akan tampak langsung di website Anda, dan bagikan pratinjaunya dengan orang yang tidak bisa mengakses Penyesuaian.','Share Preview Link'=>'Berbagi Tautan Pratinjau','Changes trashed successfully.'=>'Perubahan berhasil dibuang.','Changes have already been trashed.'=>'Perubahan sudah berhasil dibuang.','Unable to trash changes.'=>'Tidak bisa membuang perubahan.','No changes saved yet, so there is nothing to trash.'=>'Belum ada perubahan yang disimpan, jadi tidak ada yang dibuang.','There was an authentication problem. Please reload and try again.'=>'Ada masalah otentikasi. Silakan dimuat ulang dan dicoba kembali.','Unable to save due to %s invalid setting.'=>'Tidak bisa menyimpan selama ada %s masalah pengaturan.' . "\0" . 'Tidak bisa menyimpan selama ada sejumlah %s masalah pengaturan.','You must supply a future date to schedule.'=>'Anda harus menentukan tanggal yang akan datang untuk penjadwalan.','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'Beberapa setelan perubahan sebelumnya sudah diterbitkan. Silakan mencoba untuk menyimpan setelan perubahan Anda lagi.','Edit User'=>'Sunting Pengguna','View User'=>'Tampilkan Pengguna','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you have not yet, how about trying that widget instead?'=>'Widget berikut mungkin mengandung kode yang akan bekerja lebih baik di widget &#8220;HTML Khusus&#8221;. Jika belum mencobanya, kenapa tidak mencoba widget tersebut?','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Text&#8221; tab instead. Alternately, try out the